        for the non-medical use of personal protective equipment (PPE) in the EU.
        This directive aims to harmonize the minimum requirements for PPE used in
        various industries, such as construction, manufacturing, and healthcare.

        Scope:

        The Directive 402/134/EEC applies to all non-medical PPE designed to protect
        workers from risks to their safety and health at work. This includes equipment
        such as gloves, eye protection, respiratory protection, head protection, foot
        protection, and hand protection. The directive also covers PPE used in agriculture
        and forestry.

        Hazard identification:

        The Directive requires employers to identify the hazards present in their
        workplace and assess the risks associated with them. This includes a risk
        assessment of the working environment, the materials handled, and the processes
        used. The hazard identification process helps employers determine which PPE
        is required for their workers to ensure their safety and health at work.

        Minimum requirements:

        Directive 402/134/EEC sets out minimum requirements for non-medical PPE used
        in the EU. These requirements include:

        1. Protection against mechanical hazards - PPE must provide adequate protection
        against mechanical risks such as cuts, impacts, and abrasions.

        2. Protection against chemical hazards - PPE must protect workers from chemical
        risks such as skin irritation, respiratory problems, and eye damage.

        3. Protection against electrical hazards - PPE must provide adequate protection
        against electrical shocks and burns.

        4. Protection against thermal hazards - PPE must protect workers from heat
        and flame risks.

        5. Comfort and ergonomics - PPE must be designed to ensure comfort and ergonomics
        for the wearer.'
